import React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import {
  Doors, HeightAndWidth, NextButton, Windows,
} from './index';

function FirstForms() {
  const navigate = useNavigate();
  const location = useLocation();

  const handleClick = () => {
    switch (location.pathname) {
      case '/':
        navigate('/firstWall')
        break;
      case '/firstWall':
        navigate('/secondWall')
        break;
      case '/secondWall':
        navigate('/thirdWall')
        break;
      case '/thirdWall':
        navigate('/fourthWall')
        break;
      case '/fourthWall':
        navigate('/result')
        break;
      default:
        break;
    }
  };

  // const obj = { handleClick }
  return (
    <form>
      <HeightAndWidth />
      <Windows />
      <Doors />
      <NextButton handleClick={ handleClick } />
    </form>
  );
}

export default FirstForms;
